import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Auth.css'; // Import the shared CSS file

const Login = () => {
  const navigate = useNavigate();

  const handleSubmit = (event) => {
    event.preventDefault(); // Prevent the default form submission behavior
    // Perform your login logic here, e.g., validation, API call, etc.
    
    // Redirect to the "/portfolios" page after successful login
    navigate('/portfolios');
  };

  return (
    <div className="form-container">
      <div className="logo-box mb-4">
        <img src="/logo.png" alt="ICA Logo" className="logo" />
      </div>
      
      <form className="form-content" onSubmit={handleSubmit}>
        <div className="form-group mt-4">
          <input type="text" className="form-control p-3" placeholder="Username" />
        </div>
        <div className="form-group mt-4">
          <input type="password" className="form-control p-3" placeholder="Password" />
        </div>
        <button type="submit" className="submit_btn btn bg_danger p-3 mt-4">
          Log In
        </button>
        <div className="login-link mt-4">
          <p>Forgot Password? <a href="/home">Go Back</a></p>
        </div>
      </form>
    </div>
  );
};

export default Login;
